// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Protocol {

    struct CypherText {
        uint[] c;
    }

    mapping(address => CypherText) mapNode;

    function insert_encrypted_matrix(address nodeId, uint[] calldata cypher) public {
        mapNode[nodeId].c = cypher;
    }

    function get_encrypted_matrix(address nodeId) public view returns (uint[] memory cypher) {
        return mapNode[nodeId].c;
    }

    function insert_proof() public {

    }

    function get_proof() public view {

    }

}
